import React from 'react';
import Image from "react-bootstrap/Image";
import Explorers from '../../src/Explorers.PNG';
import {Container, Row, Col, Button} from 'react-bootstrap'
import ExplorerHome from '../../src/ExplorerHome.png';
import Card from 'react-bootstrap/Card';
import { MDBDataTable } from 'mdbreact';

console.log(Explorers);
console.log(ExplorerHome);

const FindaGroup = () => {
  const data = {
    columns: [
      {
        label: 'State',
        field: 'state',
        sort: 'asc',
        width: 150
      },
      {
        label: 'County',
        field: 'county',
        sort: 'asc',
        width: 270
      },
      {
        label: 'Event Name',
        field: 'eventname',
        sort: 'asc',
        width: 200
      },
      {
        label: 'Date',
        field: 'age',
        sort: 'asc',
        width: 100
      },
      {
        label: 'Start date',
        field: 'date',
        sort: 'asc',
        width: 150
      },
      {
        label: 'Salary',
        field: 'salary',
        sort: 'asc',
        width: 100
      }
    ],
    rows: [
      {
        name: 'Tiger Nixon',
        position: 'System Architect',
        office: 'Edinburgh',
        age: '61',
        date: '2011/04/25',
        salary: '$320'
      },
      {
        name: 'Garrett Winters',
        position: 'Accountant',
        office: 'Tokyo',
        age: '63',
        date: '2011/07/25',
        salary: '$170'
      },
      {
        name: 'Ashton Cox',
        position: 'Junior Technical Author',
        office: 'San Francisco',
        age: '66',
        date: '2009/01/12',
        salary: '$86'
      },
      {
        name: 'Cedric Kelly',
        position: 'Senior Javascript Developer',
        office: 'Edinburgh',
        age: '22',
        date: '2012/03/29',
        salary: '$433'
      },
      {
        name: 'Donna Snider',
        position: 'Customer Support',
        office: 'New York',
        age: '27',
        date: '2011/01/25',
        salary: '$112'
      }
    ]
  };

  return (
    <MDBDataTable
      striped
      bordered
      small
      data={data}
    />
  );
}

export default FindaGroup;
